import React from "react";
import Header from "../components/header/Header";
import BodyLayout from "../components/body/BodyLayout";
import Footer from "../components/footer/Footer";
import styled from "styled-components";
import { MenuTitle } from "../components/body/mixin/Mixin";

const ProfileSummary = styled.section`
  width: 60vw;
  height: auto;
  display: flex;
  justify-content: space-evenly;
  border: 2px solid var(--color-yellow);
  border-radius: 4px;
`;

const Section = styled.section`
  display: flex;
  flex-direction: column;
  margin: var(--margin-default) calc(var(--margin-default) / 2)
    calc(var(--margin-default) / 2) 0;
`;

const UserIconSection = styled(Section)`
  align-items: center;
`;

const UserIcon = styled.div`
  width: 24vh;
  height: 24vh;
  /* margin: calc(var(--margin-default) / 4) var(--margin-default); */
`;

const UserImage = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  overflow: hidden;
  img {
    width: 100%;
    height: 100%;
  }
`;

// const UserName = styled.div`
//   width: 24vh;
//   margin: calc(var(--margin-default) / 4) var(--margin-default);
//   font-size: var(--font-size-large);
//   text-align: center;
// `;

const UserInfoSection = styled(Section)`
  width: 72%;
`;

const MenuContainer = styled.section`
  width: 60vw;
  height: 40vh;
  margin-top: var(--margin-default);
  background-color: black;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
`;

const MenuBox = styled.div`
  width: 32%;
  height: 100%;
  background-color: white;
`;

const MyPage = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <MenuTitle>My Page</MenuTitle>
        <ProfileSummary>
          <UserIconSection>
            <UserIcon>
              <UserImage>
                <img src="images/user.jpg" alt="user" />
              </UserImage>
            </UserIcon>
            {/* <UserName>김승규 님</UserName> */}
          </UserIconSection>
          <UserInfoSection>아이디 님</UserInfoSection>
        </ProfileSummary>

        <MenuContainer>
          <MenuBox>후기</MenuBox>
          <MenuBox>찜한 장소</MenuBox>
          <MenuBox>나의 추천 코스</MenuBox>
        </MenuContainer>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default MyPage;
